import React from 'react';
import { Bar } from 'react-chartjs-2'; // Import the Bar chart component
import '../css/StatisticalData.css';
import Navbar from '../components/Navbar';

function StatisticalData() {
    const chartData = {
        labels: ['New Customers', 'Service Providers'],
        datasets: [{
            label: 'Registrations',
            data: [12, 5],
            backgroundColor: [
                'rgba(105, 42, 178, 0.5)',
                'rgba(255, 99, 132, 0.5)'
            ],
            borderColor: [
                'rgba(105, 42, 178, 1)',
                'rgba(255, 99, 132, 1)'
            ],
            borderWidth: 1
        }]
    }

    return (
        <>
            <Navbar />
            <div className='header-container'>
                <h2>Statistical Data</h2>
            </div>
            <div className="table-container">
                <Bar 
                    data={chartData}
                    options={{
                        responsive: true,
                        scales: {
                            y: {
                                beginAtZero: true,
                                ticks: {
                                    stepSize: 1 
                                }
                            }
                        }
                    }}
                />
            </div>
            <div className='header-container'>
                <p className="text-sm text-white">&copy; {new Date().getFullYear()} Developed by MaidEase. All rights reserved.</p>
            </div>
        </>
    );
}

export default StatisticalData;
